import {
  Box,
  Center,
  Container,
  Divider,
  Heading,
  Text,
  VStack,
} from "@chakra-ui/react";
import React from "react";

const RandomRecipe = () => {
  return (
    <>
      <VStack mt={20} h="full">
        <Heading>Recipe:</Heading>
        <Divider width="2xl" />
        <Box
          w="2xl"
          maxW="2xl"
          borderWidth="1px"
          borderRadius="lg"
          overflow="hidden"
        >
          <VStack p={4} alignItems="left">
            <Heading size="sm">Time to prepare:</Heading>
            <Divider width="xl" />
            <Heading size="sm">Ingredients:</Heading>
          </VStack>
        </Box>
      </VStack>
    </>
  );
};

export default RandomRecipe;
